import React, { useEffect } from 'react';
import { gsap } from 'gsap';
import './style.css'; // Inclure le fichier CSS

const MoroccanArtisanPage = () => {
  useEffect(() => {
    const timeline = gsap.timeline();

    // Animation pour le texte
    timeline
      .from('.hero-section h2', {
        y: -50, // Déplacement vers le haut
        opacity: 0,
        duration: 1,
        ease: 'power3.out',
      })
      .from('.hero-section h1', {
        y: 50, // Déplacement vers le bas
        opacity: 0,
        duration: 1,
        ease: 'power3.out',
      }, "-=0.5") // Commence avant la fin de l'animation précédente
      .from('.cta-button', {
        scale: 0.8,
        opacity: 0,
        duration: 0.8,
        ease: 'elastic.out(1, 0.3)',
      });

    // Animation pour la navbar
    gsap.from('.navbar', {
      y: -100, // Apparition depuis le haut
      opacity: 0,
      duration: 1,
      ease: 'power3.out',
    });
  }, []);

  return (
    <div className="container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="nav-links">
          <a href="#home">Home</a>
          <a href="#shop">Shop</a>
          <a href="#artisans">Artisans</a>
          <a href="#about">About</a>
          <a href="#contact">Contact</a>
        </div>
        <div className="auth-buttons">
          <button className="login-button">Log In</button>
          <button className="signup-button">Sign Up</button>
        </div>
      </nav>

      {/* Hero Section */}
      <div className="hero-section">
        <h2>Tradition Meets Innovation</h2>
        <h1>Discover Moroccan <br /> Artisan Excellence</h1>
        <button className="cta-button">Learn About Artisan</button>
      </div>
    </div>
  );
};

export default MoroccanArtisanPage;
